import React, { Component } from "react";
import axios from 'axios'


export default class labHome extends Component {

constructor(props){
  super(props);
this.state={
  lab:[]
};

}

  render() {
    return(
      <div>
          <a href="/labhome">lab</a><br/><br/>
          <a href="/sechome">kitty</a><br/><br/>
          <a href="/abhome">pawan</a><br/><br/>
          <a href="/eqhome">Buddisha</a><br/><br/>
          <a href="/get">Shanali</a><br/><br/>

          <a className='btn btn-success' href='/labhome' ><i className='fas fa-vial'></i>&nbsp;Lab</a><br/><br/>
          <a className='btn btn-success' href='/sechome' ><i className='fas fa-user-shield'></i>&nbsp;Security</a> <br/><br/>  
          <a className='btn btn-success' href='/abhome' ><i className='fas fa-ambulance'></i>&nbsp;Ambulance</a><br/><br/>
          <a className='btn btn-success' href='/eqhome' ><i className='fas fa-microscope'></i>&nbsp;Equipment</a><br/><br/>
          <a className='btn btn-danger' href='/get' ><i className='fas fa-user-nurse'></i>&nbsp;Equipment</a>

      </div>
    )
  }
}
